function letterPlacer(letter){
  if(boxNum === 0 && rowNum < 7) box1letter = letter;
  if(boxNum === 1) box2letter = letter;
  if(boxNum === 2) box3letter = letter;
  if(boxNum === 3) box4letter = letter;
  if(boxNum === 4) box5letter = letter;
  if(boxNum < 5 && rowNum < 7) boxNum += 1;
}

function letterDelete(){
  if(boxNum === 1) box1letter = "";
  if(boxNum === 2) box2letter = "";
  if(boxNum === 3) box3letter = "";
  if(boxNum === 4) box4letter = "";
  if(boxNum === 5) box5letter = "";
  if(boxNum > 0)boxNum -= 1;
}

